document.addEventListener("DOMContentLoaded",()=>{let e=Array.from(document.querySelectorAll('[class*="id-"]'));e.forEach(e=>{e.addEventListener("mouseover",()=>{let t=e.className.split(" ").find(e=>e.startsWith("id-")).substring(3),l=document.querySelectorAll(".id-"+t);l.forEach(e=>e.classList.add("bracket-highlight"))}),e.addEventListener("mouseout",()=>{let t=e.className.split(" ").find(e=>e.startsWith("id-")).substring(3),l=document.querySelectorAll(".id-"+t);l.forEach(e=>e.classList.remove("bracket-highlight"))})});let t=document.querySelectorAll(".ranking-color");t.forEach(function(e){window.getComputedStyle(e,null).getPropertyValue("background-color")})});